        function Dynamsoft_OnReady() {
            DWObject = Dynamsoft.WebTwainEnv.GetWebTwain('dwtcontrolContainer');
        }

        function AcquireImage() {
            if (DWObject) {
                if (Dynamsoft.Lib.env.bMobile) {
                    DWObject.LoadImageEx('', 5,
                        function() {
                            console.log('success');
                        },
                        function(errCode, error) {
                            alert(error);
                        }
                    );
                } else {
                    DWObject.SelectSource(function() {
                            DWObject.OpenSource();
                            DWObject.AcquireImage();
                        },
                        function() {
                            console.log("SelectSource failed!");
                        }
                    );
                }
            }
        }

        function LoadImage() {
            if (DWObject) {
                DWObject.LoadImageFromBase64Binary(caLic, Dynamsoft.EnumDWT_ImageType.IT_PNG);
            }
        }

        function ReadBarcodes() {
            DWObject.Addon.BarcodeReader.getRuntimeSettings()
                .then(function(runtimeSettings) {
                    runtimeSettings.barcodeFormatIds = Dynamsoft.EnumBarcodeFormat.BF_PDF417; //Look only for PDF417
                    return DWObject.Addon.BarcodeReader.updateRuntimeSettings(runtimeSettings);
                }, function(error) {
                    console.log(error);
                })
                .then(function(runtimeSettings) {
                    // Add an indicator
                    Dynamsoft.WebTwainEnv.OnWebTwainPreExecute();
                    return DWObject.Addon.BarcodeReader.decode(DWObject.CurrentImageIndexInBuffer);
                }, function(error) {
                    console.log(error);
                })
                .then(function(textResults) {
                    // Remove the indicator
                    Dynamsoft.WebTwainEnv.OnWebTwainPostExecute();
                    for (var i = 0; i < textResults.length; i++) {
                        alert(textResults[i].BarcodeText);
                    }
                }, function(error) {
                    // Remove the indicator
                    Dynamsoft.WebTwainEnv.OnWebTwainPostExecute();
                    console.log(error)
                });
        }

    </script>
